import React from 'react';
import { Footer, FooterWrapper, FooterWrapperChild, FooterParagraph, FooterHeading, Image, Input, Form, Address } from '../../components/styles/HuddleFooter.styled';
import FooterTopBg from '../../assests/bg-footer-top-mobile.svg';
import { LogoImage } from '../../logo';
import PhoneIcon from '../../assests/icon-phone.svg';
import EmailIcon from '../../assests/icon-email.svg';

const HuddleFooter = (props) => {
    return (
        <Footer Image={FooterTopBg}>
            <FooterWrapper Display={'column'}>
                <FooterWrapperChild Display={'column'}>
                    <LogoImage Color={'#f5faff'} />
                    <FooterParagraph>
                        Lorem ipsum dolor sit amet, consectetur adipiscing elit.
                        Mauris nulla quam, hendrerit lacinia
                        vestibulum a, ultrices quis sem.
                    </FooterParagraph>
                </FooterWrapperChild>
                <FooterWrapperChild Display={'column'}>
                    <Address>
                        <Image Src={PhoneIcon} Alt="make a phone call" />
                        <a href="tel:+1-543-123-4567">+1-543-123-4567</a>
                    </Address>
                    <Address>
                        <Image Src={EmailIcon} Alt="email us" />
                        <a href="mailto:example@huddle.com">example@huddle.com</a>
                    </Address>
                </FooterWrapperChild>
                <FooterWrapper>
                    <a href="https://www.facebook.com/skybrel/"><i class="fab fa-facebook-square"></i></a>
                    <a href="https://www.instagram.com/skybrel/"><i class="fab fa-instagram"></i></a>
                    <a href="https://twitter.com/vrma_aakash"><i class="fab fa-twitter-square"></i></a>
                </FooterWrapper>
            </FooterWrapper>
        </Footer >
    );
}

export default HuddleFooter;
